const {
  deviceEndpoints,
  electricityMeter,
  temperature,
  identify,
  iasZoneAlarm,
} = require("zigbee-herdsman-converters/lib/modernExtend");

const fz = require("zigbee-herdsman-converters/converters/fromZigbee");
const tz = require("zigbee-herdsman-converters/converters/toZigbee");
const exposes = require("zigbee-herdsman-converters/lib/exposes");
const reporting = require("zigbee-herdsman-converters/lib/reporting");
const ota = require("zigbee-herdsman-converters/lib/ota");
const utils = require("zigbee-herdsman-converters/lib/utils");
const globalStore = require("zigbee-herdsman-converters/lib/store");
const e = exposes.presets;
const ea = exposes.access;

const CONSTANTS = {
  MIN_REPORT_INTERVAL: 10,
  MAX_REPORT_INTERVAL: 90,
  REPORTABLE_CHANGE: 100,
};

const electroReporting = { min: 10, max: 90, change: 100 };
const tempReporting = { min: 60, max: 300, change: 1000 };

const fzLocal = {
  iasZoneAlarm: {
    cluster: "ssIasZone",
    type: ["commandStatusChangeNotification", "attributeReport", "readResponse"],
    convert: (model, msg, publish, options, meta) => {
      const zoneStatus = msg.type === "commandStatusChangeNotification" ? msg.data.zonestatus : msg.data.zoneStatus;
      return {
        alarm_1: (zoneStatus & 1) > 0,
      };
    },
  },
};

const definition = {
  zigbeeModel: ["ZigUSB_C6"],
  model: "ZigUSB_C6",
  vendor: "xyzroe",
  description: "Zigbee USB switch with monitoring",
  toZigbee: [tzLocal.zigusb_restart_interval],
  exposes: [
    e
      .numeric("restart", ea.SET)
      .withEndpoint("4")
      .withValueMin(1)
      .withValueMax(30)
      .withValueStep(1)
      .withDescription("OFF time")
      .withUnit("seconds"),
  ],
  extend: [
    deviceEndpoints({ endpoints: { 1: 1, 2: 2, 3: 3, 4: 4 } }),
    identify(),
    electricityMeter({
      cluster: "electrical",
      electricalMeasurementType: "both",
      current: { change: 100 },
      power: { change: 100 },
      voltage: { change: 100 },
      endpointNames: ["1"],
    }),
    temperature(),
    onOff({ endpointNames: ["1"], description: "Controls the USB port" }),
    onOff({ powerOnBehavior: false, endpointNames: ["2"], description: "Indicates the Zigbee status" }),
    onOff({ powerOnBehavior: false, endpointNames: ["3"], description: "Indicates the USB state" }),
    iasZoneAlarm({ zoneType: "generic", zoneAttributes: ["alarm_1"], description: "Over current alarm" }),
  ],
  meta: { multiEndpoint: true },
  icon: "data:image/png;base64,",
};

module.exports = definition;
